ses site to which you registered voluntarily using the email address technologiespersephone@gmail.com. If you wish to unsubscribe go to the <a href=\"https://www.phpclasses.org/unsub/n/mtbk/u/newclasses/cc/acb057/\">unsubscribe page</a>.</div>\n<table cellpadding=\"0\" cellspacing=\"0\"><tr><td valign=\"top\" style=\"padding:0;\"><h2>Class:</h2>\n<div><b><a href=\"https://www.phpclasses.org/package/10939.html\">PHP Base64 Encode File</a></b><br /><a href=\"https://www.phpclasses.org/discuss/package/10939/\">This class support forum</a></div>\n<h2>Short description:</h2>\n<div>\nEncode a file or a string as a base64 data URL</div>\n<h2>Groups:</h2>\n<div>\nHTML, PHP 5, Files and Folders</div>\n</td>\n<td valign=\"top\" width=\"1%\"></td>\n</tr></table><h2>Supplied by:</h2><div>HAKAN Ç?ÇEK</div>\n<h2>Detailed description:</h2>\n<div>This package can encode a file or a string as a base64 data URL.<br /><br />\nIt can take as parameter a string of data or the name of a file to be encoded.<br /><br />\nThe class can encode the string or file as a URL of data as using base64 so the returned string can be used as URL of a link, image or another type of reference in a Web page.</div>\n<h2>PHP Classes site tip of the day:</h2>\n<div><p><b><big><a href=\"https://www.phpclasses.org/tips.html?tip=innovation-award\">Contribute innovating classes and gain prizes and recognition</a></big></b></p>\n</div>\n<div style=\"margin:auto;\" class=\"box dark\">Persephone if you are not interested in receiving any more messages like this one, go to the <a href=\"https://www.phpclasses.org/unsub/n/mtbk/u/newclasses/cc/acb057/\">unsubscribe page</a> .</div>\n\n</div>\n      </div>\n    </div>\n  </div>\n</div>\n\n</div>\n<img src=\"https://www.phpclasses.org/open/h/bcf53b/ub/dGVjaG5vbG9naWVzcGVyc2VwaG9uZUBnbWFpbC5jb20%3D/id/62847/l/newclasses/i/open.png\" alt=\"open.png\" />',NULL,0),('43ea3052-a5a9-f911-8b1a-5be2d28183e6','talha.bilal@mails.persephone-technologies.com','talha.bilal@mails.per